import React from 'react';
import "./Footer.css";


const Footer = () => {
  return (
    <div className='footer'>
      <div className='sb_footer section_padding'>
        <div className='sb_footer-links'>
          <div className='sb_footer-links-div'>
            <h4>Footer</h4>
            <a href="./Home">Home</a>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Footer
